&lt;p&gt;&amp;#160;&lt;/p&gt;
&lt;h2 class=&quot;blue-med-dark&quot;&gt;What&apos;s making this possible?&lt;/h2&gt;
&lt;ul&gt;
&lt;li&gt;&lt;b&gt;First, our world is becoming instrumented:&lt;/b&gt; The transistor, invented 60 years ago, is the basic building block of the digital age. Now, consider a world in which there are a billion transistors per human, each one costing one ten-millionth of a cent. We&#8217;ll have that by 2010. There will likely be 4 billion mobile phone subscribers by the end of this year&#8230; and 30 billion Radio Frequency Identification tags produced globally within two years. Sensors are being embedded across entire ecosystems &#8211; supply-chains, healthcare networks, cities&#8230; even natural systems like rivers.&lt;br /&gt;
&lt;/li&gt;
&lt;li&gt;&lt;b&gt;Second, our world is becoming interconnected:&lt;/b&gt; Very soon there will be 2 billion people on the Internet. But in an instrumented world, systems and objects can now &#8220;speak&#8221; to one another, too. Think about the prospect of a trillion connected and intelligent things &#8211; cars, appliances, cameras, roadways, pipelines&#8230; even pharmaceuticals and livestock. The amount of information produced by the interaction of all those things will be unprecedented.&lt;/li&gt;
&lt;li&gt;&lt;b&gt;Third, all things are becoming intelligent:&lt;/b&gt; New computing models can handle the proliferation of end-user devices, sensors and actuators and connect them with back-end systems. Combined with advanced analytics, those supercomputers can turn mountains of data into intelligence that can be translated into action, making our systems, processes and infrastructures more efficient, more productive and responsive &#8211; in a word, smarter.&lt;/li&gt;
&lt;/ul&gt;
&lt;p&gt;&amp;#160;&lt;/p&gt;
&lt;p&gt;&amp;#160;&lt;/p&gt;
