&lt;p&gt;&amp;#160;&lt;/p&gt;
&lt;p class=&quot;&quot;&gt;While the promise of cloud computing is significant, the reality of cloud computing is not without obstacles. Providers of cloud services, whether private (intra-enterprise) or public strive to:&lt;/p&gt;
&lt;div class=&quot;ibm-container ibm-alternate&quot;&gt;
&lt;div class=&quot;ibm-container-body&quot;&gt;
&lt;ul class=&quot;ibm-bullet-list ibm-no-links&quot;&gt;
&lt;li&gt;Enable economies of scale supporting large volumes of users at increasingly lower costs&lt;/li&gt;
&lt;li&gt;Create an affordable and available supply of virtualized assets&lt;/li&gt;
&lt;li&gt;Maintain a &#8220;green footprint&#8221; in the face of energy regulations and constraints&lt;/li&gt;
&lt;li&gt;Meet service level agreements (SLAs) in spite of increased automation&lt;/li&gt;
&lt;li&gt;Secure the cloud, protecting user privacy and integrity within shared system services&lt;/li&gt;
&lt;/ul&gt;
&lt;/div&gt;
&lt;/div&gt;
&lt;p&gt;The mainframe is a cloud computing differentiator&lt;/p&gt;
&lt;p&gt;The mainframe&#8217;s leading virtualization capability makes it an obvious choice for cloud computing workloads. With the ability to rapidly provision 1000s of virtual Linux servers and share resources across the system, the mainframe supports the capacity of an entire data center in a single system.&lt;/p&gt;
&lt;p&gt;&amp;#160;&lt;/p&gt;
