&lt;h1&gt;Smart Analytics Cloud for System z&lt;/h1&gt;
&lt;p&gt;&amp;#160;&lt;/p&gt;
&lt;!-- BEGIN ADD TO MY INTERESTS --&gt;&lt;!--
&lt;div id=&quot;ibm-myinterest-module&quot;&gt;&lt;/div&gt;
--&gt;&lt;!-- END_ADD TO MY INTERESTS--&gt;&lt;/div&gt;
&lt;p&gt;&lt;!-- closes ibm-content-head --&gt;&lt;!-- TITLE_END --&gt;&lt;!-- CONTENT_BODY --&gt;&lt;/p&gt;
&lt;div id=&quot;ibm-content-body&quot;&gt;
&lt;div id=&quot;ibm-content-main&quot;&gt;&lt;!-- BEGIN HERO MODULE --&gt;&lt;!-- BEGIN HERO MODULE --&gt;&lt;!-- BEGIN BODY TEXT--&gt;
&lt;div class=&quot;ibm-container ibm-alternate&quot;&gt;
&lt;div class=&quot;ibm-container-body&quot;&gt;
&lt;p&gt;Highly competitive businesses recognize that information is critical. Having access to the right information at the right time is what enables smart businesses to make the right decisions in a timely fashion. A recent IBM Institute for Business Value &lt;a onclick=&quot;sa_onclick(this.href)&quot; href=&quot;ftp://ftp.software.ibm.com/common/ssi/pm/xb/n/gbe03211usen/GBE03211USEN.PDF&quot;&gt;study&lt;/a&gt;&lt;span class=&quot;ibm-item-note&quot;&gt; (PDF, 323KB)&lt;/span&gt; discovered that one in two business leaders do not have sufficient information from across their organization to do their jobs.&lt;/p&gt;
&lt;p&gt;IBM can help.&lt;/p&gt;
&lt;p&gt;With the &lt;strong&gt;IBM Smart Analytics Cloud&lt;/strong&gt;, we focus on transforming traditional business intelligence and analytic environments into a self service knowledge dissemination solution for the enterprise. The Smart Analytics Cloud creates a standard private cloud business intelligence solution at the customer site built on mainframe capability. This solution is designed to provide customers business intelligence (BI) services that is powered by a cloud deployment for greater efficiency with less cost and resources to reach a broader audience.&lt;/p&gt;
&lt;p&gt;A Smart Analytics Cloud:&lt;/p&gt;
&lt;ul class=&quot;ibm-bullet-list ibm-no-links&quot;&gt;
&lt;li&gt;Drastically reduces the number of departmental solutions to a single BI environment capable of supporting vast numbers of users across the lines of business.&lt;/li&gt;
&lt;li&gt;Introduces a single point of control for meeting departmental business processes, corporate security and compliance standards for easier enforcement of standardization.&lt;/li&gt;
&lt;li&gt;More effectively uses skilled BI resources to support a common BI delivery tool which can be made available across the enterprise.&lt;/li&gt;
&lt;li&gt;Reduces the capital and operating expenses needed to support enterprise wide BI services.&lt;/li&gt;
&lt;li&gt;Supports a self service approach to dispensing BI services that reduces the time, resources and costs for delivering BI services to new divisions, departments and users&lt;/li&gt;
&lt;li&gt;Supports critical thinking in the enterprise with BI Compentency Center education&lt;/li&gt;
&lt;/ul&gt;
&lt;/div&gt;
&lt;/div&gt;
