&lt;body&gt;
&lt;p&gt;A century ago, fewer than 20 cities around the world had populations in excess of 1 million people.Today, that number has swelled to 450 and will continue to grow for the foreseeable future.&lt;/p&gt;
&lt;p&gt;&amp;#160;&lt;/p&gt;
&lt;p&gt;Operationally, cities are based on a number of core systems composed of different networks, infrastructures and environments related to their key functions: city services, citizens, Business, transport, communication, water and energy. The city services system constitutes the operational activities and coordination of service delivery provided by the city authority, such as coordinating delivery across different agencies, allocating public funds, conducting physical planning activities and more. A city&#8217;s citizens system includes public safety, health and education and is central to whether it delivers a good quality of life for its citizens. A city&#8217;s business system refers to the environment that businesses face in terms of policy and regulation. Cities offer citizens and business the ability to move things around through their transport systems and to share ideas and information through their communication systems. Cities also offer two core utilities necessary for all economic and social activity &#8211; water and energy.&lt;/p&gt;
