&lt;body&gt;
&lt;p&gt;People: A city&#8217;s people system refers to its&lt;br /&gt;
human and social networks. These include&lt;br /&gt;
public safety (fire, police and disaster&lt;br /&gt;
recovery), health, education and quality of&lt;br /&gt;
life&lt;/p&gt;
&lt;p&gt;People: From demographic changes to&lt;br /&gt;
health, cities face major challenges and&lt;br /&gt;
threats to their sustainability&lt;br /&gt;
While on average urban populations are&lt;br /&gt;
growing, cities in developed countries often&lt;br /&gt;
face shrinking populations &#8211; in the last 30&lt;br /&gt;
years, more cities in the developed world&lt;br /&gt;
shrank than grew.9 These cities will require new&lt;br /&gt;
ways to stay globally competitive and attractive&lt;br /&gt;
to skilled labor. In developing cities, even&lt;br /&gt;
though they are growing, the skills challenge is&lt;br /&gt;
likely to be just as great due to brain drain, the&lt;br /&gt;
flight of people with skills to areas perceived&lt;br /&gt;
to offer greater economic opportunity.10 Cities&lt;br /&gt;
also face significant healthcare challenges,&lt;br /&gt;
ranging from infant mortality to the HIV/AIDS&lt;br /&gt;
pandemic. With growing health challenges,&lt;br /&gt;
the fiscal sustainability of health systems will&lt;br /&gt;
be pushed to the limit. In North America, for&lt;br /&gt;
example, the costs of healthcare are anticipated&lt;br /&gt;
to increase dramatically &#8211; to 20 percent&lt;br /&gt;
of GDP in the United States and more than&lt;br /&gt;
half of provincial tax revenues in Canada.&lt;/p&gt;
&lt;/body&gt;
