&lt;/style&gt;
&lt;/head&gt;
&lt;body&gt;
&lt;p&gt;Business: A city&#8217;s business system encompasses its regulation and policy environment and includes planning regulations, openness to foreign trade and investment, and labor and product market legislation.&lt;/p&gt;
&lt;p&gt;&amp;#160;&lt;/p&gt;
&lt;p&gt;Business: Cities must balance complex regulatory requirements with the need to minimize unnecessary administrative burdens&lt;br /&gt;
Cities depend on their business systems for their prosperity. Less efficient administrative systems can cost as much as 6.8 percent of GDP in some economies.16 A 25-percent reduction in administrative costs &#8211; e.g., time spent filling out forms &#8211; could yield savings of up to 1.5 percent of GDP, or some &#8364;150 billion (approximately US$209 billion).17 As Figure 3 shows, the number of days it takes to undertake the same process &#8211; starting a business &#8211; in different cities varies dramatically, even within the same country. With cities becoming more important actors politically and economically, solving the dichotomy between where laws are made and implemented will be central to the efficiency and effectiveness of cities&#8217; business systems.&amp;#160;&lt;/p&gt;
