&lt;/head&gt;
&lt;body&gt;
&lt;p&gt;Communication: A city&#8217;s communication system includes&lt;br /&gt;
its telecommunications infrastructure, including telephony,&lt;br /&gt;
broadband and wireless. The ability to access and communicate&lt;br /&gt;
information is central in a modern economy and key&lt;br /&gt;
to a smarter city.&lt;/p&gt;
&lt;p&gt;&amp;#160;&lt;/p&gt;
&lt;p&gt;Communication: Cities face challenges in meeting evergreater&lt;br /&gt;
demands for connectivity&lt;br /&gt;
The last 20 years have seen a revolution in how we communicate&lt;br /&gt;
and inform ourselves, in particular the ability to share&lt;br /&gt;
information through the Worldwide Web. However, while&lt;br /&gt;
the online population has grown by almost 350 percent since&lt;br /&gt;
2000, the vast majority of the world&#8217;s population &#8211; 5.1 billion&lt;br /&gt;
&#8211; is still not online and is denied the benefits of tapping into a&lt;br /&gt;
worldwide network of information (see Figure 4). The speed of&lt;br /&gt;
connectivity has also become increasingly important. In March&lt;br /&gt;
2009, average speeds for those with broadband varied from&lt;br /&gt;
4.6 megabits per second in Asia to 1.1 megabits per second in&lt;br /&gt;
Africa.22 As the citizens of Tokyo and Yokohama prepare for&lt;br /&gt;
gigabit-per-second connectivity, city managers must begin&lt;br /&gt;
planning for a terabit world.23&lt;/p&gt;
&lt;/body&gt;
&lt;/html&gt;

&lt;!DOCTYPE html PUBLIC &quot;-//W3C//DTD XHTML 1.0 Transitional//EN&quot; &quot;http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd&quot;&gt; 
