&lt;/style&gt;
&lt;/head&gt;
&lt;body&gt;
&lt;p&gt;Transport: A city&#8217;s transport system includes all aspects of&lt;br /&gt;
its road network, its public transport network and its sea&lt;br /&gt;
and air ports, from provision to pricing.&lt;/p&gt;
&lt;p&gt;&amp;#160;&lt;/p&gt;
&lt;p&gt;Transport: Inefficient systems will continue to drive up&lt;br /&gt;
costs without city action&lt;br /&gt;
Urbanization and globalization create more commuters and&lt;br /&gt;
more freight traffic in the world&#8217;s ports. Traffic congestion&lt;br /&gt;
cost the U.S. economy US$78 billion in 2005, resulting in 4.2&lt;br /&gt;
billion lost hours, as well as pollution and wasted fuel.18 These&lt;br /&gt;
costs are growing at 8 percent per annum.19 The economic costs&lt;br /&gt;
of congestion in New York alone are close to US$4 billion a&lt;br /&gt;
year.20 A number of estimates suggest that congestion costs &#8211; in&lt;br /&gt;
developed and developing cities &#8211; are between 1 percent and&lt;br /&gt;
3 percent of GDP..21 In emerging market cities, car ownership&lt;br /&gt;
rates are currently a fraction of the 75-90 percent of OECD&lt;br /&gt;
countries. As car ownership grows from less than one in ten&lt;br /&gt;
people to one in three or higher, even greater strain will be&lt;br /&gt;
placed on the transport infrastructure.&lt;/p&gt;
&lt;/body&gt;
&lt;/html&gt;

