&lt;/style&gt;
&lt;/head&gt;
&lt;body&gt;
&lt;p&gt;Water: A city&#8217;s water system is an essential utility that&lt;br /&gt;
includes the entire water cycle, water supply and sanitation.&lt;/p&gt;
&lt;p&gt;&amp;#160;&lt;/p&gt;
&lt;p&gt;Water: Problems with water efficiency, leakage, quality and&lt;br /&gt;
the threat of flooding pose a significant threat to cities&#8217;&lt;br /&gt;
sustainability&lt;br /&gt;
Water is fundamental for sustaining human life. Every&lt;br /&gt;
economic exchange involves a virtual exchange of water. As&lt;br /&gt;
cities grow, so does their thirst for water. Cities today account&lt;br /&gt;
for 60 percent of all water allocated for domestic human&lt;br /&gt;
use.24 However, globally, less than half of water supplies are&lt;br /&gt;
accounted for (see Figure 5). Leakage rates often represent&lt;br /&gt;
up to 60 percent of water supplied, costing water utilities&lt;br /&gt;
worldwide US$14 billion every year.&lt;/p&gt;
&lt;p&gt;Currently, 2.8 billion people, or 44 percent of the world&#8217;s population,&lt;br /&gt;
live in areas of high water stress.26 Present trends suggest&lt;br /&gt;
that this will rise to almost 4 billion by 2030 (see Figure 6).27&lt;br /&gt;
Globally, water shortages are estimated to cause an annual loss&lt;br /&gt;
to economic growth of about 3.6 per cent.28 In California, the&lt;br /&gt;
cost of water issues is already 2 percent of the state budget.&lt;/p&gt;
&lt;/body&gt;
&lt;/html&gt;

