&lt;/style&gt;
&lt;/head&gt;
&lt;body&gt;
&lt;p&gt;Energy: A city&#8217;s energy system, as essential as its water&lt;br /&gt;
resources, includes its power generation and transmission&lt;br /&gt;
infrastructure, as well as its waste disposal.&lt;/p&gt;
&lt;p&gt;&amp;#160;&lt;/p&gt;
&lt;p&gt;Energy: Cities are realizing current energy systems are&lt;br /&gt;
insecure, inefficient and unsustainable&lt;br /&gt;
Global emissions of CO2, the principal greenhouse gas, are&lt;br /&gt;
expected to have increased by more than 45 percent between&lt;br /&gt;
1990 and 2010, driven largely by the growth of cities (see&lt;br /&gt;
Figure 7). Cities generate the vast bulk of CO2 emissions;&lt;br /&gt;
therefore reducing their CO2 emissions is necessary for a&lt;br /&gt;
healthier planet. As a result, city policymakers are under&lt;br /&gt;
growing pressure &#8211; from citizens and from investors &#8211; to&lt;br /&gt;
incorporate into their policymaking environmental sustainability&lt;br /&gt;
in general and greenhouse gas emissions in particular.&lt;br /&gt;
Cities are starting to rise to this threat to their sustainability,&lt;br /&gt;
with the mayors of 400 European cities, for example, pledging&lt;br /&gt;
in February 2009 to make &#8220;drastic&#8221; cuts in CO2 emissions by&lt;br /&gt;
2020.30&lt;br /&gt;
Providing secure and sustainable energy for their citizens is a&lt;br /&gt;
key challenge for cities over the coming generation. Globally,&lt;br /&gt;
almost one in three people lack access to electricity. And while&lt;br /&gt;
access to energy is widespread in more developed cities, it is&lt;br /&gt;
still not secure. In the United States, for example, blackout&lt;br /&gt;
threats are increasing in the wake of an overall reduction of&lt;br /&gt;
baseload energy reserves from 30 percent in the early 1990s to&lt;br /&gt;
only 17 percent in 2007.31&lt;/p&gt;
&lt;/body&gt;
&lt;/html&gt;

