&lt;body&gt;
&lt;p&gt;City services: From greater individualization to fiscal constraints, city services are coming under increasing pressure Greater demands for individualized and tailored service delivery mean that city authorities are under increasing pressure to transform their approach to managing service delivery to citizens. This is reflected in opinion polls showing that people want greater choice in the use of services, with people looking for public services that are more responsive to the needs and wants of individual citizens.9 Tony Blair summarized the challenge to public service delivery as follows: &#8220;In simple terms, we are completing the re-casting of the 1945 welfare state to end entirely the era of &#8216;one size fits all&#8217; services and put in their place modern services which maintain at their core the values of equality of access and opportunity&lt;br /&gt;
for all.&#8221;10 This in turn requires far greater integration of the different services and actors involved in their delivery, in order to give greater focus on the end user rather than the individual provider of services.11 Meeting the growing demands of citizens is made more difficult by the severe budget constraints facing many cities. For example, a review of 13 major U.S. cities found that 12 of them faced budget deficits ranging from 5-20 percent of the general funds available.&amp;#160;&lt;/p&gt;
