&lt;p&gt;&lt;font color=&quot;#808040&quot; face=&quot;Verdana, Helvetica&quot; size=&quot;2&quot;&gt;&lt;font style=&quot; font-weight: bold; font-family: Verdana,Helvetica; color: black; font-size: 10pt;&quot; color=&quot;#000000&quot;&gt;Solution Name:&lt;/font&gt;&lt;font color=&quot;#808040&quot;&gt;&amp;#160;&lt;/font&gt;&lt;/font&gt;&lt;font face=&quot;Verdana, Helvetica&quot; size=&quot;2&quot;&gt; &lt;font style=&quot; font-weight: bold; font-family: Verdana,Helvetica; font-size: 10pt;&quot;&gt;Intelligent Utility Network (IUN)&lt;/font&gt;&amp;#160;&lt;br /&gt;
&lt;br /&gt;
&lt;font style=&quot; color: green; font-family: Verdana,Helvetica; font-size: 10pt;&quot; face=&quot;Verdana, Helvetica&quot; size=&quot;2&quot;&gt;&lt;font color=&quot;#000000&quot;&gt;1)&amp;#160; Solution description&lt;/font&gt;&lt;font style=&quot; font-family: Verdana,Helvetica; color: green; font-size: 10pt;&quot;&gt;&amp;#160;&lt;/font&gt;&lt;/font&gt;&amp;#160;&lt;/font&gt;&amp;#160;&lt;font color=&quot;#008040&quot;&gt;&lt;br /&gt;
&lt;/font&gt;&lt;br /&gt;
&lt;font face=&quot;Verdana, Helvetica&quot; size=&quot;2&quot;&gt;The Intelligent Utility &lt;font color=&quot;#000000&quot;&gt;Network&lt;/font&gt; (IUN) solution addresses the convergence in today&#8217;s utility market of environmental pressures, financial expectation, energy costs, regulatory transparency, aging infrastructure, limited price electricity and improved risk management. This convergence requires a new level of enterprise information and integration to allow for informed decision making.&lt;br /&gt;
&lt;br /&gt;
IUN is an IP-enabled continuous sensing network which connects all parts of the utility including equipment, control systems, applications, and employees. This enables automatic data collection and storage from across the utility based on a Common Information Model and Services Oriented Architecture, upon which analytics, simulation and modeling can be performed to support the optimization of the management of assets and operations. The solution provides for delivery of efficient system reliability and performance to meet regulatory, financial, customer and compliance expectations.&lt;br /&gt;
&lt;br /&gt;
IBM&#8217;s Intelligent Utility Network solution guides a utility in every phase of a smart grid transformation from strategy development, planning and selection through design, implementation and ongoing operations. The Intelligent Utility Network provides utilities with offerings for:&lt;/font&gt;&lt;/p&gt;
&lt;p&gt;&lt;font face=&quot;Verdana, Helvetica&quot; size=&quot;2&quot;&gt;&lt;strong&gt;Smart Metering &amp;#38; Beyond&lt;/strong&gt;&amp;#160;Enables business transformation through enhanced metering capabilities. Visioning, strategy, planning and selection, design, build, rollout and operations support for smart metering initiatives, their integration into the utility enterprise and the ensuing capabilities that smart metering enables for both the utility and the consumer.&lt;/font&gt;&lt;/p&gt;
&lt;p&gt;&lt;font face=&quot;Verdana, Helvetica&quot; size=&quot;2&quot;&gt;&lt;strong&gt;Grid Operations&lt;/strong&gt;&amp;#160;Energy management, remote monitoring, grid management systems...parallel to grid ops..regulatory compliance and informed decision making..&lt;br /&gt;
Provides enhanced operational and analytical capabilities throughout distribution network operations. Development, planning, implementation of asset monitoring and energy management systems required for grid operations and their integration into the utility operations environment and enterprise to take advantage of this information for business and operational intelligence.&lt;/font&gt;&lt;/p&gt;
&lt;p&gt;&lt;font face=&quot;Verdana, Helvetica&quot; size=&quot;2&quot;&gt;&lt;strong&gt;Intelligent Utility Network Security&lt;/strong&gt;&amp;#160;Provides tools and methodologies to enhance physical and cyber security characteristics of the smart grid. Comprehensive cyber security offering covering major aspects of utility security from assessment, strategy, policy, planning and development to managed security operations.&lt;/font&gt;&lt;/p&gt;
&lt;p&gt;&lt;font face=&quot;Verdana, Helvetica&quot; size=&quot;2&quot;&gt;&lt;strong&gt;Intelligent Utility Network&lt;/strong&gt;&amp;#160;Communications Networks Apply methodologies which will optimize communications aspects of the smart grid. Assessment and development of utility-wide voice and data communications strategy to enable information exchange across all the components of a Smart Grid. Further provide planning, design, implementation and operation of IUN communications networks.&lt;br /&gt;
IBM also helps utilities extend distribution capabilities into homes, commercial operations and cars.&lt;/font&gt;&lt;/p&gt;
